INSERT INTO `tbl_event` (`event_id`, `nameEvent`, `title`, `short_content`, `content`, `startDay`, `endDay`, `place`, `request`, `create_at`, `update_at`, `img`, `type_event`, `clb_id`) VALUES
(21, 'Người dân thế giới mong đợi gì cho Năm mới 2021', '<p><span style=\"font-size:16px\"><strong>VOV.VN - Kh&eacute;p lại một năm 2020 đầy biến động, c&oacute; lẽ ngo&agrave;i những điều mong ước cho bản th&acirc;n v&agrave; gia đ&igrave;nh, chưa bao giờ người d&acirc;n thế giới lại c&oacute; chung một mong ước giản dị như hiện nay.</strong></span></p>\r\n', '<p>Kh&ocirc;ng c&oacute; những m&agrave;n đếm ngược đ&ocirc;ng nghẹt người hay c&aacute;c bữa tiệc tưng bừng tr&ecirc;n đường phố, nhưng người d&acirc;n thế giới vẫn đ&oacute;n ch&agrave;o 2021 với nhưng những m&agrave;n ph&aacute;o hoa rực s&aacute;ng tr&ecirc;n bầu trời đ&ecirc;m mang theo nhiều hi vọng v&agrave; ước nguyện về một năm mới&nbsp;y&ecirc;n b&igrave;nh v&agrave; tươi s&aacute;ng hơn.</p>\r\n', '<p>Kh&ocirc;ng v&igrave; Covid-19 m&agrave; những tiếng chu&ocirc;ng đồng hồ Big Ben của Anh ng&acirc;n b&eacute; hơn hay những người tham dự tại đ&oacute;, d&ugrave; với số lượng rất hạn chế, cũng cảm thấy bớt h&agrave;o hứng hơn khi thời khắc năm mới đến.</p>\r\n\r\n<p>Đối với người d&acirc;n Anh sau nhiều năm Brexit trắc trở, năm 2021 l&agrave; thời điểm ch&iacute;nh thức nước Anh ra khỏi ng&ocirc;i nh&agrave; chung ch&acirc;u &Acirc;u, với nhiều những hi vọng về thịnh vượng v&agrave; ph&aacute;t triển sẽ đến với người d&acirc;n xứ sở sương m&ugrave;.</p>\r\n\r\n<p>&ldquo;Thật tuyệt vời khi Brexit cũng ho&agrave;n th&agrave;nh. Hi vọng nước Anh sẽ c&oacute; sự khởi đầu tốt hơn. Đ&acirc;y sẽ l&agrave; điều tuyệt vời&rdquo;, một người d&acirc;n Anh cho biết.</p>\r\n\r\n<p>&ldquo;T&ocirc;i kh&aacute; lo lắng v&igrave; năm nay l&agrave; năm quan trọng khi t&ocirc;i tốt nghiệp đại học trong bối cảnh đất nước c&oacute; nhiều thay đổi. Hi vọng mọi thứ sẽ tốt đẹp&rdquo;, một người kh&aacute;c b&agrave;y tỏ.</p>\r\n\r\n<p>Năm mới đến với người d&acirc;n Nga bằng m&agrave;n ph&aacute;o hoa rực rỡ tr&ecirc;n Quảng trường đỏ v&agrave; Điện Kremlin mặc d&ugrave; họ chỉ được tận hưởng kh&ocirc;ng kh&iacute; qua m&agrave;n h&igrave;nh. Quảng trường bị phong tỏa, c&aacute;c nh&agrave; h&agrave;ng v&agrave; qu&aacute;n bar đ&oacute;ng cửa để giảm nguy cơ l&acirc;y nhiễm dịch bệnh cũng l&agrave; điều th&uacute; vị, khi c&aacute;c gia đ&igrave;nh c&oacute; cơ hội qu&acirc;y quần trong khoảnh khắc quan trọng nhất. Một nước Nga thịnh vượng v&agrave; ph&aacute;t triển l&agrave; điều nhiều người d&acirc;n nước n&agrave;y mong muốn trong năm 2021.</p>\r\n\r\n<p>&ldquo;Năm mới mang đến hi vọng về sự th&agrave;nh c&ocirc;ng v&agrave; mới mẻ. Nước Nga sẽ ph&aacute;t triển mạnh mẽ v&agrave; điều quan trọng nhất l&agrave; h&ograve;a b&igrave;nh. Ch&uacute;c mừng năm mới mọi người&rdquo;, một người d&acirc;n ở Moscow n&oacute;i.</p>\r\n\r\n<p>Trầm lắng hơn một ch&uacute;t so với mọi năm nhưng kh&ocirc;ng v&igrave; thế kh&ocirc;ng kh&iacute; năm mới tại c&aacute;c nước Trung Đ&ocirc;ng k&eacute;m rộn r&agrave;ng Từ Dubai hoa lệ đến th&agrave;nh phố Mosul bất ổn của Iraq, những người d&acirc;n Trung Đ&ocirc;ng vẫn đ&oacute;n năm mới với ph&aacute;o hoa rực r&otilde; v&agrave; &acirc;m nhạc rộn r&agrave;ng. Ngo&agrave;i những điểm tổ chức đ&oacute;n năm mới lớn hạn chế người tham dự được truyền trực tuyến tới người d&acirc;n, tiếng nhạc đ&oacute;n ch&agrave;o năm mới vẫn rộn r&agrave;ng tr&ecirc;n phố, chen v&agrave;o từng ng&ocirc;i nh&agrave;, cộng hưởng th&agrave;nh một bữa tiệc &acirc;m nhạc s&ocirc;i động. Kh&ocirc;ng kh&iacute; năm mới cũng tr&agrave;n đến th&agrave;nh phố Mosul của Iraq - nơi chứng kiến xung đột v&agrave; bất ổn nhiều năm qua. Đối với người d&acirc;n th&agrave;nh phố, 2021 l&agrave; năm mới của hi vọng v&agrave; h&ograve;a b&igrave;nh cho người d&acirc;n th&agrave;nh phố vốn đ&atilde; chịu nhiều mất m&aacute;t.</p>\r\n\r\n<p>&ldquo;Mosul đ&atilde; kh&ocirc;ng c&ograve;n chiến tranh nhưng lại phải đối mặt với một năm dịch bệnh. Kinh tế kh&oacute; khăn v&agrave; đại dịch vẫn tiếp diễn. Tuy nhi&ecirc;n ch&uacute;ng ta vẫn phải sống v&agrave; lạc quan. V&igrave; vậy ch&uacute;ng t&ocirc;i vẫn tổ chức đ&oacute;n tiệc năm mới nhưng tu&acirc;n thủ c&aacute;c điều kiện nghi&ecirc;m ngặt&rdquo;, người d&acirc;n Mosul b&agrave;y tỏ.</p>\r\n\r\n<p>Kh&eacute;p lại một năm 2020 đầy biến động, c&oacute; lẽ ngo&agrave;i những điều mong ước cho bản th&acirc;n v&agrave; gia đ&igrave;nh, chưa bao giờ người d&acirc;n thế giới lại c&oacute; chung một mong ước giản dị như hiện nay. Từ ch&acirc;u &Acirc;u, ch&acirc;u &Aacute; hay đến ch&acirc;u Phi đầy nắng gi&oacute;, người d&acirc;n đều c&oacute; chung một điều ước đ&oacute; l&agrave; &ldquo;mong đại dịch Covid-19 qua nhanh để được đi lại v&agrave; trở về cuộc sống b&igrave;nh thường như trước:</p>\r\n\r\n<p>Kh&ocirc;ng kh&iacute; đ&oacute;n năm mới 2021&nbsp;c&oacute; trầm lắng hơn mọi năm do đại dịch, nhưng người d&acirc;n thế giới vẫn tận hưởng thời khắc quan trọng bằng những c&aacute;ch đặc biệt, với tinh thần lạc quan, hy vọng thế giới sẽ c&oacute; một Năm mới 2021 nhiều may mắn hơn./.</p>\r\n', '2021-01-01 13:59:00', '2021-01-16 13:59:00', 'Việt Nam', 'test', '2021-01-01 07:49:39', NULL, '53ad00415a.png', 1, 0),
(22, 'Người dân thế giới mong đợi gì cho Năm mới 2021', '<p><span style=\"font-size:16px\"><strong>VOV.VN - Kh&eacute;p lại một năm 2020 đầy biến động, c&oacute; lẽ ngo&agrave;i những điều mong ước cho bản th&acirc;n v&agrave; gia đ&igrave;nh, chưa bao giờ người d&acirc;n thế giới lại c&oacute; chung một mong ước giản dị như hiện nay.</strong></span></p>\r\n', '<p>Kh&ocirc;ng c&oacute; những m&agrave;n đếm ngược đ&ocirc;ng nghẹt người hay c&aacute;c bữa tiệc tưng bừng tr&ecirc;n đường phố, nhưng người d&acirc;n thế giới vẫn đ&oacute;n ch&agrave;o 2021 với nhưng những m&agrave;n ph&aacute;o hoa rực s&aacute;ng tr&ecirc;n bầu trời đ&ecirc;m mang theo nhiều hi vọng v&agrave; ước nguyện về một năm mới&nbsp;y&ecirc;n b&igrave;nh v&agrave; tươi s&aacute;ng hơn.</p>\r\n', '<p>Kh&ocirc;ng v&igrave; Covid-19 m&agrave; những tiếng chu&ocirc;ng đồng hồ Big Ben của Anh ng&acirc;n b&eacute; hơn hay những người tham dự tại đ&oacute;, d&ugrave; với số lượng rất hạn chế, cũng cảm thấy bớt h&agrave;o hứng hơn khi thời khắc năm mới đến.</p>\r\n\r\n<p>Đối với người d&acirc;n Anh sau nhiều năm Brexit trắc trở, năm 2021 l&agrave; thời điểm ch&iacute;nh thức nước Anh ra khỏi ng&ocirc;i nh&agrave; chung ch&acirc;u &Acirc;u, với nhiều những hi vọng về thịnh vượng v&agrave; ph&aacute;t triển sẽ đến với người d&acirc;n xứ sở sương m&ugrave;.</p>\r\n\r\n<p>&ldquo;Thật tuyệt vời khi Brexit cũng ho&agrave;n th&agrave;nh. Hi vọng nước Anh sẽ c&oacute; sự khởi đầu tốt hơn. Đ&acirc;y sẽ l&agrave; điều tuyệt vời&rdquo;, một người d&acirc;n Anh cho biết.</p>\r\n\r\n<p>&ldquo;T&ocirc;i kh&aacute; lo lắng v&igrave; năm nay l&agrave; năm quan trọng khi t&ocirc;i tốt nghiệp đại học trong bối cảnh đất nước c&oacute; nhiều thay đổi. Hi vọng mọi thứ sẽ tốt đẹp&rdquo;, một người kh&aacute;c b&agrave;y tỏ.</p>\r\n\r\n<p>Năm mới đến với người d&acirc;n Nga bằng m&agrave;n ph&aacute;o hoa rực rỡ tr&ecirc;n Quảng trường đỏ v&agrave; Điện Kremlin mặc d&ugrave; họ chỉ được tận hưởng kh&ocirc;ng kh&iacute; qua m&agrave;n h&igrave;nh. Quảng trường bị phong tỏa, c&aacute;c nh&agrave; h&agrave;ng v&agrave; qu&aacute;n bar đ&oacute;ng cửa để giảm nguy cơ l&acirc;y nhiễm dịch bệnh cũng l&agrave; điều th&uacute; vị, khi c&aacute;c gia đ&igrave;nh c&oacute; cơ hội qu&acirc;y quần trong khoảnh khắc quan trọng nhất. Một nước Nga thịnh vượng v&agrave; ph&aacute;t triển l&agrave; điều nhiều người d&acirc;n nước n&agrave;y mong muốn trong năm 2021.</p>\r\n\r\n<p>&ldquo;Năm mới mang đến hi vọng về sự th&agrave;nh c&ocirc;ng v&agrave; mới mẻ. Nước Nga sẽ ph&aacute;t triển mạnh mẽ v&agrave; điều quan trọng nhất l&agrave; h&ograve;a b&igrave;nh. Ch&uacute;c mừng năm mới mọi người&rdquo;, một người d&acirc;n ở Moscow n&oacute;i.</p>\r\n\r\n<p>Trầm lắng hơn một ch&uacute;t so với mọi năm nhưng kh&ocirc;ng v&igrave; thế kh&ocirc;ng kh&iacute; năm mới tại c&aacute;c nước Trung Đ&ocirc;ng k&eacute;m rộn r&agrave;ng Từ Dubai hoa lệ đến th&agrave;nh phố Mosul bất ổn của Iraq, những người d&acirc;n Trung Đ&ocirc;ng vẫn đ&oacute;n năm mới với ph&aacute;o hoa rực r&otilde; v&agrave; &acirc;m nhạc rộn r&agrave;ng. Ngo&agrave;i những điểm tổ chức đ&oacute;n năm mới lớn hạn chế người tham dự được truyền trực tuyến tới người d&acirc;n, tiếng nhạc đ&oacute;n ch&agrave;o năm mới vẫn rộn r&agrave;ng tr&ecirc;n phố, chen v&agrave;o từng ng&ocirc;i nh&agrave;, cộng hưởng th&agrave;nh một bữa tiệc &acirc;m nhạc s&ocirc;i động. Kh&ocirc;ng kh&iacute; năm mới cũng tr&agrave;n đến th&agrave;nh phố Mosul của Iraq - nơi chứng kiến xung đột v&agrave; bất ổn nhiều năm qua. Đối với người d&acirc;n th&agrave;nh phố, 2021 l&agrave; năm mới của hi vọng v&agrave; h&ograve;a b&igrave;nh cho người d&acirc;n th&agrave;nh phố vốn đ&atilde; chịu nhiều mất m&aacute;t.</p>\r\n\r\n<p>&ldquo;Mosul đ&atilde; kh&ocirc;ng c&ograve;n chiến tranh nhưng lại phải đối mặt với một năm dịch bệnh. Kinh tế kh&oacute; khăn v&agrave; đại dịch vẫn tiếp diễn. Tuy nhi&ecirc;n ch&uacute;ng ta vẫn phải sống v&agrave; lạc quan. V&igrave; vậy ch&uacute;ng t&ocirc;i vẫn tổ chức đ&oacute;n tiệc năm mới nhưng tu&acirc;n thủ c&aacute;c điều kiện nghi&ecirc;m ngặt&rdquo;, người d&acirc;n Mosul b&agrave;y tỏ.</p>\r\n\r\n<p>Kh&eacute;p lại một năm 2020 đầy biến động, c&oacute; lẽ ngo&agrave;i những điều mong ước cho bản th&acirc;n v&agrave; gia đ&igrave;nh, chưa bao giờ người d&acirc;n thế giới lại c&oacute; chung một mong ước giản dị như hiện nay. Từ ch&acirc;u &Acirc;u, ch&acirc;u &Aacute; hay đến ch&acirc;u Phi đầy nắng gi&oacute;, người d&acirc;n đều c&oacute; chung một điều ước đ&oacute; l&agrave; &ldquo;mong đại dịch Covid-19 qua nhanh để được đi lại v&agrave; trở về cuộc sống b&igrave;nh thường như trước:</p>\r\n\r\n<p>Kh&ocirc;ng kh&iacute; đ&oacute;n năm mới 2021&nbsp;c&oacute; trầm lắng hơn mọi năm do đại dịch, nhưng người d&acirc;n thế giới vẫn tận hưởng thời khắc quan trọng bằng những c&aacute;ch đặc biệt, với tinh thần lạc quan, hy vọng thế giới sẽ c&oacute; một Năm mới 2021 nhiều may mắn hơn./.</p>\r\n', '2021-01-01 13:59:00', '2021-01-16 13:59:00', 'Việt Nam', 'test', '2021-01-13 15:04:08', NULL, '45ec6c7d25.jpeg', 1, 0),
