grave;n h&igrave;nh. Quảng trường bị phong tỏa, c&aacute;c nh&agrave; h&agrave;ng v&agrave; qu&aacute;n bar đ&oacute;ng cửa để giảm nguy cơ l&acirc;y nhiễm dịch bệnh cũng l&agrave; điều th&uacute; vị, khi c&aacute;c gia đ&igrave;nh c&oacute; cơ hội qu&acirc;y quần trong khoảnh khắc quan trọng nhất. Một nước Nga thịnh vượng v&agrave; ph&aacute;t triển l&agrave; điều nhiều người d&acirc;n nước n&agrave;y mong muốn trong năm 2021.</p>\r\n\r\n<p>&ldquo;Năm mới mang đến hi vọng về sự th&agrave;nh c&ocirc;ng v&agrave; mới mẻ. Nước Nga sẽ ph&aacute;t triển mạnh mẽ v&agrave; điều quan trọng nhất l&agrave; h&ograve;a b&igrave;nh. Ch&uacute;c mừng năm mới mọi người&rdquo;, một người d&acirc;n ở Moscow n&oacute;i.</p>\r\n\r\n<p>Trầm lắng hơn một ch&uacute;t so với mọi năm nhưng kh&ocirc;ng v&igrave; thế kh&ocirc;ng kh&iacute; năm mới tại c&aacute;c nước Trung Đ&ocirc;ng k&eacute;m rộn r&agrave;ng Từ Dubai hoa lệ đến th&agrave;nh phố Mosul bất ổn của Iraq, những người d&acirc;n Trung Đ&ocirc;ng vẫn đ&oacute;n năm mới với ph&aacute;o hoa rực r&otilde; v&agrave; &acirc;m nhạc rộn r&agrave;ng. Ngo&agrave;i những điểm tổ chức đ&oacute;n năm mới lớn hạn chế người tham dự được truyền trực tuyến tới người d&acirc;n, tiếng nhạc đ&oacute;n ch&agrave;o năm mới vẫn rộn r&agrave;ng tr&ecirc;n phố, chen v&agrave;o từng ng&ocirc;i nh&agrave;, cộng hưởng th&agrave;nh một bữa tiệc &acirc;m nhạc s&ocirc;i động. Kh&ocirc;ng kh&iacute; năm mới cũng tr&agrave;n đến th&agrave;nh phố Mosul của Iraq - nơi chứng kiến xung đột v&agrave; bất ổn nhiều năm qua. Đối với người d&acirc;n th&agrave;nh phố, 2021 l&agrave; năm mới của hi vọng v&agrave; h&ograve;a b&igrave;nh cho người d&acirc;n th&agrave;nh phố vốn đ&atilde; chịu nhiều mất m&aacute;t.</p>\r\n\r\n<p>&ldquo;Mosul đ&atilde; kh&ocirc;ng c&ograve;n chiến tranh nhưng lại phải đối mặt với một năm dịch bệnh. Kinh tế kh&oacute; khăn v&agrave; đại dịch vẫn tiếp diễn. Tuy nhi&ecirc;n ch&uacute;ng ta vẫn phải sống v&agrave; lạc quan. V&igrave; vậy ch&uacute;ng t&ocirc;i vẫn tổ chức đ&oacute;n tiệc năm mới nhưng tu&acirc;n thủ c&aacute;c điều kiện nghi&ecirc;m ngặt&rdquo;, người d&acirc;n Mosul b&agrave;y tỏ.</p>\r\n\r\n<p>Kh&eacute;p lại một năm 2020 đầy biến động, c&oacute; lẽ ngo&agrave;i những điều mong ước cho bản th&acirc;n v&agrave; gia đ&igrave;nh, chưa bao giờ người d&acirc;n thế giới lại c&oacute; chung một mong ước giản dị như hiện nay. Từ ch&acirc;u &Acirc;u, ch&acirc;u &Aacute; hay đến ch&acirc;u Phi đầy nắng gi&oacute;, người d&acirc;n đều c&oacute; chung một điều ước đ&oacute; l&agrave; &ldquo;mong đại dịch Covid-19 qua nhanh để được đi lại v&agrave; trở về cuộc sống b&igrave;nh thường như trước:</p>\r\n\r\n<p>Kh&ocirc;ng kh&iacute; đ&oacute;n năm mới 2021&nbsp;c&oacute; trầm lắng hơn mọi năm do đại dịch, nhưng người d&acirc;n thế giới vẫn tận hưởng thời khắc quan trọng bằng những c&aacute;ch đặc biệt, với tinh thần lạc quan, hy vọng thế giới sẽ c&oacute; một Năm mới 2021 nhiều may mắn hơn./.</p>\r\n', '2021-01-01 13:59:00', '2021-01-16 13:59:00', 'Việt Nam', 'test', '2021-01-13 15:04:43', NULL, '0a73352b74.jpg', 1, 0),
(24, 'Người dân thế giới mong đợi gì cho Năm mới 2021', '<p><span style=\"font-size:16px\"><strong>VOV.VN - Kh&eacute;p lại một năm 2020 đầy biến động, c&oacute; lẽ ngo&agrave;i những điều mong ước cho bản th&acirc;n v&agrave; gia đ&igrave;nh, chưa bao giờ người d&acirc;n thế giới lại c&oacute; chung một mong ước giản dị như hiện nay.</strong></span></p>\r\n', '<p>Kh&ocirc;ng c&oacute; những m&agrave;n đếm ngược đ&ocirc;ng nghẹt người hay c&aacute;c bữa tiệc tưng bừng tr&ecirc;n đường phố, nhưng người d&acirc;n thế giới vẫn đ&oacute;n ch&agrave;o 2021 với nhưng những m&agrave;n ph&aacute;o hoa rực s&aacute;ng tr&ecirc;n bầu trời đ&ecirc;m mang theo nhiều hi vọng v&agrave; ước nguyện về một năm mới&nbsp;y&ecirc;n b&igrave;nh v&agrave; tươi s&aacute;ng hơn.</p>\r\n', '<p>Kh&ocirc;ng v&igrave; Covid-19 m&agrave; những tiếng chu&ocirc;ng đồng hồ Big Ben của Anh ng&acirc;n b&eacute; hơn hay những người tham dự tại đ&oacute;, d&ugrave; với số lượng rất hạn chế, cũng cảm thấy bớt h&agrave;o hứng hơn khi thời khắc năm mới đến.</p>\r\n\r\n<p>Đối với người d&acirc;n Anh sau nhiều năm Brexit trắc trở, năm 2021 l&agrave; thời điểm ch&iacute;nh thức nước Anh ra khỏi ng&ocirc;i nh&agrave; chung ch&acirc;u &Acirc;u, với nhiều những hi vọng về thịnh vượng v&agrave; ph&aacute;t triển sẽ đến với người d&acirc;n xứ sở sương m&ugrave;.</p>\r\n\r\n<p>&ldquo;Thật tuyệt vời khi Brexit cũng ho&agrave;n th&agrave;nh. Hi vọng nước Anh sẽ c&oacute; sự khởi đầu tốt hơn. Đ&acirc;y sẽ l&agrave; điều tuyệt vời&rdquo;, một người d&acirc;n Anh cho biết.</p>\r\n\r\n<p>&ldquo;T&ocirc;i kh&aacute; lo lắng v&igrave; năm nay l&agrave; năm quan trọng khi t&ocirc;i tốt nghiệp đại học trong bối cảnh đất nước c&oacute; nhiều thay đổi. Hi vọng mọi thứ sẽ tốt đẹp&rdquo;, một người kh&aacute;c b&agrave;y tỏ.</p>\r\n\r\n<p>Năm mới đến với người d&acirc;n Nga bằng m&agrave;n ph&aacute;o hoa rực rỡ tr&ecirc;n Quảng trường đỏ v&agrave; Điện Kremlin mặc d&ugrave; họ chỉ được tận hưởng kh&ocirc;ng kh&iacute; qua m&agrave;n h&igrave;nh. Quảng trường bị phong tỏa, c&aacute;c nh&agrave; h&agrave;ng v&agrave; qu&aacute;n bar đ&oacute;ng cửa để giảm nguy cơ l&acirc;y nhiễm dịch bệnh cũng l&agrave; điều th&uacute; vị, khi c&aacute;c gia đ&igrave;nh c&oacute; cơ hội qu&acirc;y quần trong khoảnh khắc quan trọng nhất. Một nước Nga thịnh vượng v&agrave; ph&aacute;t triển l&agrave; điều nhiều người d&acirc;n nước n&agrave;y mong muốn trong năm 2021.</p>\r\n\r\n<p>&ldquo;Năm mới mang đến hi vọng về sự th&agrave;nh c&ocirc;ng v&agrave; mới mẻ. Nước Nga sẽ ph&aacute;t triển mạnh mẽ v&agrave; điều quan trọng nhất l&agrave; h&ograve;a b&igrave;nh. Ch&uacute;c mừng năm mới mọi người&rdquo;, một người d&acirc;n ở Moscow n&oacute;i.</p>\r\n\r\n<p>Trầm lắng hơn một ch&uacute;t so với mọi năm nhưng kh&ocirc;ng v&igrave; thế kh&ocirc;ng kh&iacute; năm mới tại c&aacute;c nước Trung Đ&ocirc;ng k&eacute;m rộn r&agrave;ng Từ Dubai hoa lệ đến th&agrave;nh phố Mosul bất ổn của Iraq, những người d&acirc;n Trung Đ&ocirc;ng vẫn đ&oacute;n năm mới với ph&aacute;o hoa rực r&otilde; v&agrave; &acirc;m nhạc rộn r&agrave;ng. Ngo&agrave;i những điểm tổ chức đ&oacute;n năm mới lớn hạn chế người tham dự được truyền trực tuyến tới người d&acirc;n, tiếng nhạc đ&oacute;n ch&agrave;o năm mới vẫn rộn r&agrave;ng tr&ecirc;n phố, chen v&agrave;o từng ng&ocirc;i nh&agrave;, cộng hưởng th&agrave;nh một bữa tiệc &acirc;m nhạc s&ocirc;i động. Kh&ocirc;ng kh&iacute; năm mới cũng tr&agrave;n đến th&agrave;nh phố Mosul của Iraq - nơi chứng kiến xung đột v&agrave; bất ổn nhiều năm qua. Đối với người d&acirc;n th&agrave;nh phố, 2021 l&agrave; năm mới của hi vọng v&agrave; h&ograve;a b&igrave;nh cho người d&acirc;n th&agrave;nh phố vốn đ&atilde; chịu nhiều mất m&aacute;t.</p>\r\n\r\n<p>&ldquo;Mosul đ&atilde; kh&ocirc;ng c&ograve;n chiến tranh nhưng lại phải đối mặt với một năm dịch bệnh. Kinh tế kh&oacute; khăn v&agrave; đại dịch vẫn tiếp diễn. Tuy nhi&ecirc;n ch&uacute;ng ta vẫn phải sống v&agrave; lạc quan. V&igrave; vậy ch&uacute;ng t&ocirc;i vẫn tổ chức đ&oacute;n tiệc năm mới nhưng tu&acirc;n thủ c&aacute;c điều kiện nghi&ecirc;m ngặt&rdquo;, người d&acirc;n Mosul b&agrave;y tỏ.</p>\r\n\r\n<p>Kh&eacute;p lại một năm 2020 đầy biến động, c&oacute; lẽ ngo&agrave;i những điều mong ước cho bản th&acirc;n v&agrave; gia đ&igrave;nh, chưa bao giờ người d&acirc;n thế giới lại c&oacute; chung một mong ước giản dị như hiện nay. Từ ch&acirc;u &Acirc;u, ch&acirc;u &Aacute; hay đến ch&acirc;u Phi đầy nắng gi&oacute;, người d&acirc;n đều c&oacute; chung một điều ước đ&oacute; l&agrave; &ldquo;mong đại dịch Covid-19 qua nhanh để được đi lại v&agrave; trở về cuộc sống b&igrave;nh thường như trước:</p>\r\n\r\n<p>Kh&ocirc;ng kh&iacute; đ&oacute;n năm mới 2021&nbsp;c&oacute; trầm lắng hơn mọi năm do đại dịch, nhưng người d&acirc;n thế giới vẫn tận hưởng thời khắc quan trọng bằng những c&aacute;ch đặc biệt, với tinh thần lạc quan, hy vọng thế giới sẽ c&oacute; một Năm mới 2021 nhiều may mắn hơn./.</p>\r\n', '2021-01-01 13:59:00', '2021-01-16 13:59:00', 'Việt Nam', 'test', '2021-01-06 12:04:00', NULL, '53ad00415a.png', 1, 0),
(31, 'Thu-Tai-Thiet-Ke-Thoi-Trang-Cua-Sinh-Vien', '<p>asda</p>\r\n', '', '<p>asdasd</p>\r\n', '2021-01-15 17:48:00', '2021-01-08 17:48:00', 'TP.HCM', 'SV năm 4', '2021-01-15 10:48:32', NULL, 'e6b1b1be2f.jpg', 2, 4),
(33, 'Đội bóng chuyền nam HUTECH gây ấn tượng mạnh tại bảng A', '<p><em>H&ocirc;m qua (11/12), Giải B&oacute;ng chuyền sinh vi&ecirc;n HUTECH mở rộng lần 1 năm 2018 của Trường Đại học C&ocirc;ng nghệ TP.HCM (HUTECH) - tiếp tục ng&agrave;y thi đấu thứ ba với 3 trận đấu ở nội dung nam, kh&eacute;p lại lượt trận thứ hai với vị tr&iacute; đứng thứ 2 bảng A l&agrave; HUTECH.</em></p>\r\n', '<p>Ng&agrave;y thi đấu thứ ba của Giải B&oacute;ng chuyền sinh vi&ecirc;n HUTECH mở rộng lần 1 năm 2018 tiếp tục diễn ra c&aacute;c trận tranh t&agrave;i giữa c&aacute;c đội b&oacute;ng ở nội dung nam. Trong đ&oacute;, bảng A với 2 trận đấu giữa HUTECH &ndash; ĐH B&aacute;ch khoa (ĐHQG TP. HCM) v&agrave; ĐH Văn Lang &ndash; ĐH N&ocirc;ng l&acirc;m đ&atilde; kh&eacute;p lại lượt trận thứ hai với chiến thắng 2 &ndash; 0 kh&aacute; dễ d&agrave;ng của ĐH N&ocirc;ng L&acirc;m trước c&aacute;c ch&agrave;ng trai của ĐH Văn Lang với tỉ số từng v&aacute;n&nbsp;đấu lần lượt l&agrave; 25</p>\r\n', '<p dir=\"ltr\">&ndash; 18 v&agrave; 25 &ndash; 10. Trong khi đ&oacute;, trận đấu giữa ĐH B&aacute;ch khoa v&agrave; HUTECH lại kịch t&iacute;nh ngay từ những ph&uacute;t đầu ti&ecirc;n với m&agrave;n rượt đuổi, so k&egrave; từng điểm số trong suốt 3 v&aacute;n&nbsp;đấu. HUTECH tuy c&oacute; lợi thế về chiều cao với c&aacute;c chủ c&ocirc;ng đập b&oacute;ng từ vị tr&iacute; số 4 đầy uy lực nhưng ĐH B&aacute;ch khoa lại sở hữu những cầu thủ với sức bật tốt v&agrave; những pha xử l&yacute; b&oacute;ng th&ocirc;ng minh k&egrave;m theo sự may mắn n&ecirc;n đ&atilde; chiến thắng 2 &ndash; 1 trước đội chủ nh&agrave; HUTECH.<br />\r\n&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><img alt=\"\" src=\"https://www.hutech.edu.vn/imgnews/homepage/stories/hinh212-sea/IMG_8003.JPG\" style=\"height:0px\" /><br />\r\n<br />\r\n<img alt=\"\" src=\"https://www.hutech.edu.vn/imgnews/homepage/stories/hinh212-sea/IMG_8006.JPG\" style=\"height:0px\" /><br />\r\n<br />\r\n<img alt=\"\" src=\"https://www.hutech.edu.vn/imgnews/homepage/stories/hinh212-sea/IMG_8008.JPG\" style=\"height:0px\" /><br />\r\n<em>C&aacute;c pha b&oacute;ng đẹp mắt từ c&aacute;c đội b&oacute;ng trong kh&ocirc;ng kh&iacute; cạnh tranh quyết liệt</em></p>\r\n\r\n<p dir=\"ltr\"><br />\r\nKết th&uacute;c lượt trận thứ hai của bảng A, B&aacute;ch Khoa tạm dẫn đầu bảng với 5&nbsp;điểm, ĐH HUTECH đứng thứ 2 với 4&nbsp;điểm, ĐH N&ocirc;ng L&acirc;m c&ugrave;ng xếp thứ ba với 3&nbsp;điểm, cuối c&ugrave;ng l&agrave; ĐH Văn Lang.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><img alt=\"\" src=\"https://www.hutech.edu.vn/imgnews/homepage/stories/hinh212-sea/IMG_8120.JPG\" style=\"height:0px\" /><br />\r\n<br />\r\n<img alt=\"\" src=\"https://www.hutech.edu.vn/imgnews/homepage/stories/hinh212-sea/IMG_8095.JPG\" style=\"height:0px\" /><br />\r\n<br />\r\n<img alt=\"\" src=\"https://www.hutech.edu.vn/imgnews/homepage/stories/hinh212-sea/IMG_8063.JPG\" style=\"height:0px\" /><br />\r\n<em>C&aacute;c ch&agrave;ng trai HUTECH tạm đứng vị tr&iacute; thứ 2&nbsp;bảng A sau lượt đấu ng&agrave;y 11/12 vừa qua</em>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><br />\r\nNgo&agrave;i ra, trong ng&agrave;y thi đấu thứ ba cũng diễn ra trận đấu ở bảng B với chiến thắng 2 &ndash; 0 tương đối dễ d&agrave;ng d&agrave;nh cho c&aacute;c cầu thủ Trường ĐH Khoa học tự nhi&ecirc;n (ĐHQG TP. HCM) trước ĐH C&ocirc;ng nghệ S&agrave;i G&ograve;n.&nbsp;</p>\r\n', '2021-01-29 10:27:00', '2021-02-01 10:27:00', 'TP.HCM', 'SV năm 4', '2021-01-28 03:28:42', NULL, 'a85ece3b38.jpg', 2, 2),
(34, 'Đội bóng chuyền nam HUTECH gây ấn tượng mạnh tại bảng A', '<p>Mặc d&ugrave; c&ograve;n 2 ng&agrave;y nữa (17/07/2014) Lễ ra qu&acirc;n chiến dịch M&ugrave;a h&egrave; xanh HUTECH 2014 mới ch&iacute;nh thức diễn ra nhưng c&aacute;c chiến sỹ tại 02 mặt trận: Quận B&igrave;nh Thạnh v&agrave; huyện H&oacute;c M&ocirc;n (TP.HCM) đ&atilde; sớm bắt tay thực hiện nhiệm vụ của m&igrave;nh.</p>\r\n', '<p>Cụ thể s&aacute;ng ng&agrave;y 12/7/2014 đ&ocirc;ng đảo chiến sỹ M&ugrave;a h&egrave; xanh của HUTECH tại địa b&agrave;n Quận B&igrave;nh Thạnh đ&atilde; phối hợp c&ugrave;ng Quận Đo&agrave;n B&igrave;nh Thạnh tiến h&agrave;nh hoạt động dọn dẹp vệ sinh, ph&aacute;t quang v&agrave; nạo v&eacute;t k&ecirc;nh tại khu d&acirc;n cư thuộc Phường 25 &ndash; Quận B&igrave;nh Thạnh, Tp.HCM. Với chủ đề &ldquo;V&igrave; khu phố sạch đẹp văn minh nghĩa t&igrave;nh&rdquo;, từ ch&iacute;nh đ&ocirc;i b&agrave;n tay của những người tr&iacute; thức trẻ, c&aacute;c chiến sỹ đ&atilde; kh&ocirc;ng quản ngại kh&oacute; khăn để c&ugrave;ng chung sức v&agrave; mang đến một kh&ocirc;ng gian sống xanh, sạch, đẹp hơn cho b&agrave; con nơi đ&acirc;y.</p>\r\n', '<p>Đặc biệt, ngay sau Lễ ra qu&acirc;n cấp th&agrave;nh tổ chức v&agrave;o s&aacute;ng ng&agrave;y 13/7, h&agrave;ng trăm Sinh vi&ecirc;n HUTECH đ&atilde; c&ugrave;ng sinh vi&ecirc;n c&aacute;c trường Đại học, Cao đẳng tr&ecirc;n địa b&agrave;n Th&agrave;nh phố triển khai khơi th&ocirc;ng d&ograve;ng chảy c&aacute;c đoạn k&ecirc;nh khu vực B&igrave;nh Thạnh v&agrave; rạch B&agrave; cả Bốn &ndash; Quận 12.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"https://www.hutech.edu.vn/imgnews/homepage/stories/hinh73-ase/smart_thumbs/10511150_459888310821165_455522546090517378_n_thumb_medium620_0.jpg\" style=\"height:0px\" /><br />\r\n<em>Chiến sỹ MHX HUTECH c&ugrave;ng chung tay với sinh vi&ecirc;n c&aacute;c trường khơi th&ocirc;ng d&ograve;ng chảy c&aacute;c đoạn k&ecirc;nh khu vực B&igrave;nh Thạnh v&agrave; rạch B&agrave; cả Bốn &ndash; Quận 12</em></p>\r\n\r\n<p><br />\r\nCũng nằm trong chuỗi hoạt động M&ugrave;a h&egrave; xanh, s&aacute;ng 14/7/2014, c&aacute;c chiến sỹ thuộc mặt trận huyện Ho&oacute;c M&ocirc;n, Tp.HCM cũng đ&atilde; tiến h&agrave;nh Lễ d&acirc;ng hương tại khu tưởng niệm Ng&atilde; Ba Giồng. C&aacute;c chiến sỹ t&igrave;nh nguyện cũng đ&atilde; di chuyển về địa b&agrave;n đ&oacute;ng qu&acirc;n v&agrave; từng bước ổn định nơi ăn, chốn ở v&agrave; c&ocirc;ng t&aacute;c.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"https://www.hutech.edu.vn/imgnews/homepage/stories/hinh73-ase/smart_thumbs/10527809_459881457488517_9109165115652865819_n_thumb_medium620_0.jpg\" style=\"height:0px\" /></p>\r\n\r\n<p><img src=\"https://www.hutech.edu.vn/imgnews/homepage/stories/hinh73-ase/smart_thumbs/1926631_459881964155133_3928494432915127358_n_thumb_medium620_0.jpg\" style=\"height:0px\" /></p>\r\n\r\n<p><img src=\"https://www.hutech.edu.vn/imgnews/homepage/stories/hinh73-ase/smart_thumbs/10276980_459881704155159_3155323530112021670_n_thumb_medium620_0.jpg\" style=\"height:0px\" /><br />\r\n<em>S&aacute;ng 14/7/2014, c&aacute;c chiến sỹ thuộc mặt trận huyện Ho&oacute;c M&ocirc;n, Tp.HCM cũng đ&atilde; tiến h&agrave;nh Lễ d&acirc;ng hương tại khu tưởng niệm Ng&atilde; Ba Giồng</em></p>\r\n\r\n<p><br />\r\nLễ ra qu&acirc;n chiến dịch M&ugrave;a h&egrave; xanh HUTECH 2014 sẽ&nbsp; diễn ra v&agrave;o l&uacute;c&nbsp;<strong>08g30 ng&agrave;y 17/7/2014</strong>&nbsp;tại sảnh ch&iacute;nh Trụ sở 475A Điện Bi&ecirc;n Phủ của Trường. Ch&uacute;c c&aacute;c chiến sỹ lu&ocirc;n giữ vững tinh thần &ldquo;đi để cống hiến &ndash; đi để trưởng th&agrave;nh&rdquo; v&agrave; quan trọng hơn hết l&agrave; c&oacute; sức khỏe v&agrave; tinh thần tốt nhất để chiến dịch M&ugrave;a h&egrave; xanh HUTECH 2014&nbsp; trở th&agrave;nh cột mốc đ&aacute;ng nhớ của bản th&acirc;n sinh vi&ecirc;n, của cộng đồng x&atilde; hội.</p>\r\n\r\n<table border=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td><br />\r\n			Ban chỉ huy chiến dịch M&ugrave;a h&egrave; xanh 2014 tr&acirc;n trọng cảm ơn sự đồng h&agrave;nh của C&ocirc;ng ty Holcim Việt Nam, CLB Senri Rotary, Cty Văn Tấn Ho&agrave;ng trong t&agrave;i trợ vật tư, kinh ph&iacute; để triển khai c&aacute;c c&ocirc;ng tr&igrave;nh, phần việc. Ngo&agrave;i ra, cũng xin cảm ơn c&aacute;c thầy c&ocirc; trong to&agrave;n trường đ&atilde; c&oacute; những đ&oacute;ng g&oacute;p, động vi&ecirc;n cho c&aacute;c chiến sỹ trước thềm lễ Ra qu&acirc;n chiến dịch.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2021-01-29 10:34:00', '2021-02-01 10:34:00', 'TP.HCM', 'SV năm 4', '2021-01-28 03:34:28', NULL, '68f457f8e4.jpg', 1, 0);
