INSERT INTO `tbl_news` (`news_id`, `nameNews`, `short_content`, `newCreate_at`, `img`, `newsContens`, `tieude`, `updated_at`) VALUES
(1, 'Second divided from', '<p>Second divided from form fish beast made every of seas all gathered us saying he our</p>\r\n', '2021-01-06 11:07:49', '7b0c86c704.jpg', 'MCSE boot camps have its supporters and its detractors. Some people do not understand why you should have to spend money on boot camp when you can get the MCSE study materials yourself at a fraction of the camp price. However, who has the willpower\r\n\r\nMCS', 'Second divided from', NULL),
(8, 'Lần đầu ĐH HUTECH cấp học bổng thạc sĩ', '<p>Bên cạnh 400 suất học bổng Nguyễn Văn Đạo, ĐH HUTECH lần đầu tiên chọn ra 30 học sinh xuất sắc nhất để cấp học bổng toàn phần đào tạo từ cử nhân lên thẳng tiến sĩ, với tổng giá trị quỹ lên tới 5 triệu USD.</p>', '2021-01-06 12:37:12', '7b0c86c704.jpg', '<p>Kh&ocirc;ng v&igrave; Covid-19 m&agrave; những tiếng chu&ocirc;ng đồng hồ Big Ben của Anh ng&acirc;n b&eacute; hơn hay những người tham dự tại đ&oacute;, d&ugrave; với số lượng rất hạn chế, cũng cảm thấy bớt h&agrave;o hứng hơn khi thời khắc năm mới đế', 'Lần đầu ĐH HUTECH cấp học bổng thạc sĩ', NULL),
(9, 'Học sinh Hà Nội được nghỉ 11 ngày tết', '<p>UBND th&agrave;nh phố H&agrave; Nội vừa đồng &yacute; với đề xuất của Sở Gi&aacute;o dục v&agrave; Đ&agrave;o tạo về việc cho học sinh nghỉ tết Tết Nguy&ecirc;n đ&aacute;n T&acirc;n M&atilde;o 11 ng&agrave;y.</p>\r\n', '2021-01-06 12:40:14', '7b0c86c704.jpg', '<p>Kh&ocirc;ng v&igrave; Covid-19 m&agrave; những tiếng chu&ocirc;ng đồng hồ Big Ben của Anh ng&acirc;n b&eacute; hơn hay những người tham dự tại đ&oacute;, d&ugrave; với số lượng rất hạn chế, cũng cảm thấy bớt h&agrave;o hứng hơn khi thời khắc năm mới đế', '<p><em><strong>Học sinh H&agrave; Nội được nghỉ 11 ng&agrave;y Tết</strong></em></p>\r\n', NULL),
(10, 'Giám đốc tuổi mèo và thành tích đáng nể', '<p>Học hết lớp 9, Nguyễn Hữu Năm phải nghỉ học v&igrave; nh&agrave; ngh&egrave;o lại đ&ocirc;ng con, nhưng ch&agrave;ng trai đất Chương Mỹ (H&agrave; Nội) đ&atilde; xuất sắc gi&agrave;nh nhiều giải thưởng s&aacute;ng tạo trẻ v&agrave; hiện l&agrave; chủ c', '2021-01-06 12:40:16', '0f32acf769.jpg', '<p>Kh&ocirc;ng v&igrave; Covid-19 m&agrave; những tiếng chu&ocirc;ng đồng hồ Big Ben của Anh ng&acirc;n b&eacute; hơn hay những người tham dự tại đ&oacute;, d&ugrave; với số lượng rất hạn chế, cũng cảm thấy bớt h&agrave;o hứng hơn khi thời khắc năm mới đế', '<p><u>Gi&aacute;m đốc tuổi m&egrave;o v&agrave; th&agrave;nh t&iacute;ch đ&aacute;ng nể&nbsp;</u></p>\r\n', NULL),
(11, 'Hỗ trợ gần 3000 vé tết cho sinh viên', '<p>Mỗi khi m&aacute;y bay sắp hạ c&aacute;nh xuống s&acirc;n bay Suvarnabhumi, t&ocirc;i đều c&oacute; cảm gi&aacute;c m&igrave;nh sắp được trở về nh&agrave;, về qu&ecirc; hương th&acirc;n thương thứ hai của m&igrave;nh. Bạn Đặng Quốc Ch&iacute; chia sẻ.K', '2021-01-06 12:40:18', 'eec0cbc979.jpg', '<p>Kh&ocirc;ng v&igrave; Covid-19 m&agrave; những tiếng chu&ocirc;ng đồng hồ Big Ben của Anh ng&acirc;n b&eacute; hơn hay những người tham dự tại đ&oacute;, d&ugrave; với số lượng rất hạn chế, cũng cảm thấy bớt h&agrave;o hứng hơn khi thời khắc năm mới đế', '<p>Hỗ trợ gần 3.000 v&eacute; xe tết cho sinh vi&ecirc;n</p>\r\n', NULL),
(12, 'Những tân sinh viên mồi côi, hiếu học', '<p>Mẹ mất năm 2007, 2 năm sau bố cũng ra đi, khiến 6 anh chị em của Nguyễn Huy Chiến (H&agrave; Tĩnh) sau giờ học lại phải đi l&agrave;m để kiếm sống. Nhờ nỗ lực vươn l&ecirc;n, Chiến vừa trở th&agrave;nh t&acirc;n sinh vi&ecirc;n của ĐH Điện lực H&agrave;</p>\r\n', '2021-01-06 12:40:19', 'eec0cbc979.jpg', '<p>Kh&ocirc;ng v&igrave; Covid-19 m&agrave; những tiếng chu&ocirc;ng đồng hồ Big Ben của Anh ng&acirc;n b&eacute; hơn hay những người tham dự tại đ&oacute;, d&ugrave; với số lượng rất hạn chế, cũng cảm thấy bớt h&agrave;o hứng hơn khi thời khắc năm mới đế', '<p><em><strong>Những t&acirc;n sinh vi&ecirc;n mồ c&ocirc;i, hiếu học</strong></em></p>\r\n', NULL),
(20, 'Những tân sinh viên mồi côi, hiếu học', '<p>Mẹ mất năm 2007, 2 năm sau bố cũng ra đi, khiến 6 anh chị em của Nguyễn Huy Chiến (H&agrave; Tĩnh) sau giờ học lại phải đi l&agrave;m để kiếm sống. Nhờ nỗ lực vươn l&ecirc;n, Chiến vừa trở th&agrave;nh t&acirc;n sinh vi&ecirc;n của ĐH Điện lực H&agrave;</p>\r\n', '2021-01-06 12:40:21', '027ee5bf61.jpg', '<p>Kh&ocirc;ng v&igrave; Covid-19 m&agrave; những tiếng chu&ocirc;ng đồng hồ Big Ben của Anh ng&acirc;n b&eacute; hơn hay những người tham dự tại đ&oacute;, d&ugrave; với số lượng rất hạn chế, cũng cảm thấy bớt h&agrave;o hứng hơn khi thời khắc năm mới đế', '<p>Những t&acirc;n sinh vi&ecirc;n mồi c&ocirc;i, hiếu học</p>\r\n', NULL);
